import axios from "axios";
import React, { useEffect } from "react";
import { useState } from "react";
import { Table } from "react-bootstrap";
import Header from "./Header";

const Usercrud = () => {
  const [user, getuser] = useState([]);

  

  useEffect(function () {
    axios.get("http://localhost:8000/api/user").then(
      function (rsp) {
        //console.log(rsp)
        getuser(rsp.data);
      },
      function (err) {}
    );
  }, []);

  
    return (
      <body cl>
        <div className="">
          <Header />
          <br />
          <section class="col-lg-10 offset-lg-1 ">
            <Table striped bordered hover size="lg">
              <thead>
                <tr className=" bg-primary">
                  <th>Id</th>
                  <th>Firstname</th>
                  <th>Lastname</th>
                  <th>Email</th>
                  <th>Password</th>
                  <th>Phone</th>
                  <th>Usertype</th>
                  <th>Address</th>
                </tr>
              </thead>
              <tbody className="">
                {user.map((dc) => (
                  <tr>
                    <td>{dc.id}</td>
                    <td>{dc.firstname}</td>
                    <td>{dc.lastname}</td>
                    <td>{dc.email}</td>
                    <td>{dc.password}</td>
                    <td>{dc.phone}</td>
                    <td>{dc.usertype}</td>
                    <td>{dc.address}</td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </section>
        </div>
      </body>
    );
};

export default Usercrud;
